import { useState } from "react";

export function MyCustomInput() {
    const [text, setText]=useState<string>("");

    return<>
    <div>
        <div>
            <input type="text" value={text} onChange={ev => setText(ev.target.value)}></input>
        </div>
        {text.length === 0 && <div>Campo Obbligatorio!</div>}
    </div>
    </>
}
